import React, { Component } from "react";
import "./PostList.scss";

class PostList extends Component {
    render() {
        const posts = this.props.postList.map((post, idx) => (
            <p key={idx}>{post.data}</p>
        ));
        return (
            <div className="PostList">
                <h2>Post List</h2>
                {posts}
            </div>


        );

    }

}

export default PostList;
